-- ----------------------------
-- Table structure for club
-- ----------------------------
DROP TABLE IF EXISTS `club`;
CREATE TABLE `club`  (
  `id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT,
  `clubNO` int(11) NOT NULL DEFAULT 0 COMMENT '俱乐部号码',
  `name` varchar(45) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '俱乐部名称',
  `coin` int(11) NOT NULL DEFAULT 0 COMMENT '俱乐部金币',
  `ownerId` int(11) NOT NULL COMMENT '创建人',
  `userSum` int(11) NOT NULL DEFAULT 0 COMMENT '用户数量',
  `clubUrl` varchar(256) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '俱乐部头像',
  `status` tinyint(1) NOT NULL DEFAULT 0 COMMENT '状态 0 申请中, 1 正常 2 禁用',
  `type` tinyint(1) NOT NULL DEFAULT 0 COMMENT '类型或等级(备用)',
  `tableNum` int(11) NOT NULL DEFAULT 2,
  `feeType` tinyint(1) NOT NULL DEFAULT 0 COMMENT '房费类型 0 房主 1 分摊',
  `feeTypeUpdateDate` date NULL DEFAULT NULL COMMENT '房费修改日期',
  `broadcast` varchar(256) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT '' COMMENT '公告',
  `province` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT '' COMMENT '省',
  `city` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT '' COMMENT '市',
  `county` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT '' COMMENT '县/区',
  `addr` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '地址',
  `ctime` datetime(0) NOT NULL COMMENT '创建时间',
  `utime` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `clubNO`(`clubNO`) USING BTREE,
  INDEX `status`(`status`) USING BTREE,
  INDEX `ownerId`(`ownerId`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 135 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci COMMENT = '俱乐部列表' ROW_FORMAT = Compact;

